    console.log(props)
    return (  
        <h1>Rentals</h1>
    );
}

const mapStateToProps = state => {
    return { 
        authErrorr: state.auth.authError
    }
}
const mapDispatchToProps = (dispatch) => {
    return {
        SignIn : (newUser) => dispatch(SignIn(newUser))
    }
}


export default (Rentals);
